import React from "react";
import cn from "classnames";
import styles from "./Bids.module.sass";

const Bids = ({ className, items }) => {
  console.log(items[0].blockEventData)
  return (
    <div className={cn(styles.users, className)}>
      <div className={styles.list}>
        {items.map((x, index) => (
          <div className={styles.item} key={index}>
            <div className={styles.avatar}>
            {x.profile_image ? <img src={`https://nfluence-assets.s3.amazonaws.com/${items.blockEventData.user}-profile`} alt="Avatar" /> : <img src={`data:image/png;base64,${x.avatar}`} alt="Avatar" />}
        </div>
            <div className={styles.details}>
              <div className={styles.name}>${x.blockEventData.bidPrice}</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Bids;
